description:
The BR 420 for Train Simulator, developed by Michael Fruchtl, is available in Deutsche Bahns distinctive red and white livery and features combined throttle and brake control, SIFA driver vigilance device, PZB warning system, operating sun visors, cab and desk lighting, automatic couplings, and configurable destination displays. 

The locomotive is also Quick Drive compatible, giving you the freedom to drive the DB BR 420 on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the Munich-Augsburg route (available separately and required to play these scenarios).


Please support the developers and buy some of their content if you can afford it.


Please use the email address or the facebook fanpage for requests, questions and also if you want to share an addon with the community which we will post on your behalf.

If you would like to contribute, please read the Readme.pdf.


